create table menu
(
    id          BIGINT(19) auto_increment comment 'ID'
        primary key,
    create_time DATETIME(19) null comment '创建日期',
    i_frame     BIT          null comment '是否外链',
    name        VARCHAR(255) null comment '菜单名称',
    component   VARCHAR(255) null comment '组件',
    pid         BIGINT(19)   not null comment '上级菜单ID',
    sort        BIGINT(19)   not null comment '排序',
    icon        VARCHAR(255) null comment '图标',
    path        VARCHAR(255) null comment '链接地址',
    hidden      VARCHAR(1)   null comment '是否隐藏'
);

